import { Children, JSXElementConstructor, MouseEventHandler, ReactElement, ReactFragment, ReactPortal, useEffect, useState } from 'react'
import './botao.css'
interface Props{
    children:string,
    onclick:()=>void

}

function Botao({children,onclick}:Props){
    const [lista,setLista] = useState([0])


    useEffect(() => {

            const Numeros = Array.from({ length: 25 }, (e, i) => i + 1).sort(() => Math.random() - 0.5).filter((e, i) => i < 15);


            setLista(Numeros)



    },[lista])





    return(
        <div  className="container">
            <img src="data:image/png;base64,"/>

            <h1>Jogos Lotofacil </h1>
            <table className="numeros">

                    {lista.map(i=> <td key={i}>{i.toString()}</td>) }
            </table>

        <button 
        onClick={props.onclick}
        >
            {props.Children}
        </button>
        </div>
    )
}
export default Botao;
